function App(){

    let usuario =  JSON.parse(sessionStorage.getItem('usuarioActivo'));
    var rol= usuario.map(usuario => <div>{usuario.Lider_proyecto_idLider_proyecto}</div>)
    console.log(rol)
    return(   
     
                
                usuario ? <Menu/> : <Sesion/>  
  
               
    );
}

export default App;
